package main

import (
	"encoding/hex"
	"github.com/usechain/go-usechain/common/hexutil"
	"fmt"
)

func main()  {
	//a:=""

	b:=""

	dst,_:=hex.DecodeString(b)
	c := hexutil.Bytes(dst)[:]
	fmt.Println(c)
}




func decodeHex(s string) []byte {
	b, err := hex.DecodeString(s)
	if err != nil {
		panic(err)
	}
	return b
}